private void addDoc(IndexWriter writer, String value)
{
    Document doc = new Document();
    doc.add(Field.UnStored("content", value));

    try
    {
        writer.addDocument(doc);
    }
    catch (IOException e)
    {
        e.printStackTrace();
    }
}

